import Link from 'next/link';

const Index = () => (
    <div className='outerdiv'>
        <div className='titlelogo'>
            <Link href='/'>
                <a>slern.io</a>
            </Link>
        </div>
        <div className='signin'>
            Sign In

        </div>

        <style jsx>{`
        .outerdiv {
            background-color: #B0D3F3;
            width: 100%;
            height: 80px;
            display: grid;
            font-family: Arial;  
            margin: 0px;
            padding: 0px;  
            border: 0px;  
            padding: 10px;
            grid-template-columns: 95% 5%;

        }
        .titlelogo {
            color: #2181D5;
            font-weight: bold;

            font-size: 20px;
            text-decoration: none;
            font-family: 'Arial';
        }
        a {
            text-decoration: none;
            font-family: 'Arial';
          }

          a:hover {
            opacity: 0.6;
          }
            html,body{margin:0;padding:0}

        `}</style>
    </div>
);

export default Index;
